83D08ABB-CDB4-4AEE-879A-83119D90B8B0.source:
var envScene = new THREE.Scene();

var geometry = new THREE.IcosahedronBufferGeometry( 20, 2 );
var material = new THREE.MeshStandardMaterial( { metalness: 0, side: THREE.BackSide } );
var mesh = new THREE.Mesh( geometry, material );
envScene.add( mesh );

var light = new THREE.PointLight( 0xffffff, 0.02, 20 );
light.position.set( 0, 0, 10 );
envScene.add( light );

var geometry = new THREE.BoxBufferGeometry( 1, 0.1, 10 );
var material = new THREE.MeshLambertMaterial( {
	color: 0x000000, emissive: 0xaaaaff, emissiveIntensity: 10
} );

var mesh = new THREE.Mesh( geometry, material );
mesh.position.set( 0, 4, 0 );
envScene.add( mesh );

var material = new THREE.MeshLambertMaterial( {
	color: 0x000000, emissive: 0xff4444, emissiveIntensity: 5
} );

var mesh = new THREE.Mesh( geometry, material );
mesh.position.set( 0, - 4, 0 );
envScene.add( mesh );

var pmremGenerator = new THREE.PMREMGenerator( renderer );
var renderTarget = pmremGenerator.fromScene( envScene );

scene.background = renderTarget.texture;
scene.environment = renderTarget.texture;

43CFA1BF-E184-4C34-963F-A120A0412AC4.source:
function update( event ) {

	var time = event.time / 1000;

	this.position.x = Math.sin( time );
	this.position.y = Math.cos( time / 2.123 );
	this.position.z = Math.cos( time / 3.456 );

	this.rotation.x = time / 2;
	this.rotation.y = time;

}

